product_features:
9am Dive by Afnan is a Aromatic Aquatic fragrance for women and men.
This is a new fragrance.9am Dive was launched in 2022
Top notes are Mint, Lemon, Black Currant and Pink Pepper;
middle notes are Apple, Incense and Cedar;
base notes are Ginger, Patchouli, Sandalwood and Jasmine.

Weekend for Women by Burberry is a Floral fragrance for women.
Weekend for Women was launched in 1997. The nose behind this fragrance is Nathalie Lorson.
Top notes are Mignonette, Mandarin Orange and Sage;
middle notes are Nectarine, Blue Hyacinth, Peach Blossom, Rose Hip, Iris, Red Cyclamen and Violet Root;
base notes are Musk, Sandalwood and Cedar.

NYC FOREVER; Inspired by the energy of New York City, this seductively invigorating scent blends sexy, playful, and deliciously unexpected notes to create a ready-for-anything fragrance for your days and nights on the town;
SEXY CITY CHIC; NYC arrives with notes of Italian Mandarin, White Osthamus and Wild Strawberries, with a heart of Gardenia, Honeysuckle, Mimosa, and Red Damascene Rose, easing into a base of Vanilla Absolute, Sandalwood, Rum, and Creamy Musk;
FASHION, FRAGRANCE, FUN; Created with swatches from Sarah Jessica Parker’s hand-selected favorite New York City fabric shops, a passion for fashion shines through in this unique, eclectic, and effortlessly trendy bottle design;
BEAUTIFUL, RARE, AND ALWAYS UNEXPECTED; A connoisseur of fragrance, the iconic actress and designer Sarah Jessica Parker’s expansion into the world of perfume has yielded a world of enticing and highly curated fragrances;
LOVELY AND BEYOND; Since SJP’s first launch of the iconic Lovely in 2005, the celebrity perfume House has been on top of the market, expanding the Lovely family and crafting a wide range of perfumes, body mists, and self-care products;
